import React from 'react';
import Slide1 from '../utils/Caurosel_img/slide-1.jpg';
import "../styles/Home.css";

function Home() {
  return (
    <div className="container mt-4">
  <div className="card custom-card shadow-sm">
    <div className="card-body">
      <img src={Slide1} alt="Sengundhar Thirumana Mandapam" className="card-img-top mb-3 rounded" />
      <h2 className="card-title text-primary">Sengundhar Thirumana Mandapam</h2>
      <p className="card-text text-muted">Located Opp to Murugan Kovil</p>
    </div>
    <button className="btn btn-success btn-lg w-100 custom-btn">View Details</button>
  </div>
</div>
  )
}

export default Home
